import React, { Component } from "react";
import Marquee from "./listenComponents/Marquee";
import "./listen.css";

export default class Listen extends Component {
  constructor(props) {
    super(props);
    this.state = {
      mp3path: "./audio/",
      mp3name: "Stronger",
      mp3artist: "Mowgli",
      audiopath: "",
      mp3autoplay: "autoPlay",
      mp3genre: "pop",
      soundwaveCssClass: "soundwave-hidden",
      currentButtonId: 0,
      clickedButtonId: "",
      mp3Data: [],
      restartTimer: "no"
    };
  }
  render() {
    return (
      <div className="audio-container" title="title">
        <Marquee
          mp3artist="Lea Hughes"
          mp3genre="ambient"
          title="title"
        ></Marquee>
      </div>
    );
  }
}
